import React from 'react';
import { Link } from 'react-router-dom';

function Navigation() {
  return (
    <nav className="top-nav">
      <ul>
        <li>
          <Link to="/">홈</Link>
        </li>
        <li>
          <Link to="/story">회사 소개</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navigation;
